import React from 'react';
import Accueil from './page/Accueil';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Accueil />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;
